    false,nt"url": null,nt"notes": "Dewberry collected LiDAR for ~3,341 square
    miles in various Virginia Counties, a part of Worcester County, and Hoopers Island.
    The acquisition was performed by Terrapoint. This metadata covers the LiDAR produced
    for the Virginia Counties North project area. The nominal pulse spacing for this
    project is 1.6 ft (0.5 meters). This project was collected with a sensor which collects
    intensity values for each discrete pulse extracted from the waveform. GPS Week Time,
    Intensity, Flightline and echo number attributes were provided for each LiDAR point.
    Dewberry used proprietary procedures to classify the LAS according to contract specifications:
    1-Unclassified, 2-Ground, 7-Noise, 9-Water, 10-Ignored Ground due to breakline proximity,
    and 11-Withheld (Reclassed to 15). Dewberry produced 3D breaklines and combined
    these with the final LiDAR data to produce seamless hydro flattened DEMs for the
    2,140 tiles (5000 ft x 5000 ft) that cover the project area. This collection has
    been divided into 2 parts (North and South), due to a portion of the data being
    collected in two zones: Virginia State Plane North 4501 and Virginia State Plane
    South 4502.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
